import React from "react";
import add,{sub,div,mul}  from './Clock';
function Calcu(){


    return(
        <>
        <ul>
            <li> Sum of two number is {add (10,2)}</li>
            <li> Sub of two number is {sub (10,2)}</li>
            <li> Div of two number is {div (40,3)}</li>
            <li> Mul of two number is {mul (10,2)}</li>
        </ul>
    
    </>
    );
}

export default calc;
